import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the Trending navigation item to be visible
    await page.waitForSelector('a.nav-item[data-page="trending"]');

    // Click on the Trending navigation item
    await page.click('a.nav-item[data-page="trending"]');

    // Wait for the content to load after clicking
    await page.waitForLoadState('networkidle');

    // Take a screenshot after clicking
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_trending_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_trending_clicked.png'));

    // Extract meaningful data to verify task completion
    const pageTitle = await page.title();
    const trendingSectionVisible = await page.isVisible('h1:has-text("Trending")');

    return {
      success: true,
      action: "Clicked on the Trending navigation item to view trending videos",
      extractedData: {
        pageTitle,
        trendingSectionVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

